import Container from "react-bootstrap/Container"

function Splash(){
    return (
        <Container fluid>
            <div style={"color"}>
                <h1>Josh Rivera</h1>
                <p>
                    A fledgling software developer with a love for computers.
                </p>
            </div>
        </Container>
    )
}

export default Splash
